import json

def extract_names(json_data):
    # Parse the JSON object
    data = json.loads(json_data)
    
    # Get the list under the "results" tag
    results = data.get("results", [])
    
    # Loop through the array, extract the "taxon" -> "name" tag and format it
    for result in results:
        taxon = result.get("taxon", {})
        name = taxon.get("name", "")
        
        # Wrap the name in <option> tags and print it
        print(f"<option>{name}</option>")

